import React, { Component } from 'react';
import { Card, Col, Image,Row } from 'react-bootstrap';
class Info_user extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (

            <Card>
                <Row>
                    <Col>
                        <Image src='https://viblo.asia/images/mm.png'></Image>
                    </Col>
                    <Col>
                        <h1><Card.Title>{this.props.title}</Card.Title></h1>
                        <Card.Body>{this.props.content}</Card.Body>
                    </Col>
                </Row>
            </Card>
        );
    }
}

export default Info_user;
